    false,nt"url": null,nt"notes": "The NOAA Office for Coastal Management's
    Coastal Change Analysis Program, in cooperation with the St. Johns River and South
    Florida Water Management Districts, used the C-CAP protocol to map SAV and other
    benthic habitat in Indian River. The project incorporated underwater videography,
    field point observations, and transect data. Analytical photogrammetry was used
    to accomplish the mapping. The benthic data is classified according to the System
    for Classification of Habitats in Estuarine and Marine Environments (SCHEME). This
    system is fully described in "Development of a System for Classification of Habitats
    in Estuarine and Marine Environments (SCHEME) for Florida, Report to U.S. EPA -
    Gulf of Mexico Program, Florida Fish and Wildlife Conservation Commission, Florida
    Marine Research Institute.Review Draft 12/04/02."",nt"license_title": null,nt"extras":
